import "./Trending.css";
import "../MainPage.css"
import Button from "../../Button/Button";

import ExampleImage from '../../../assets/example-movie-image.jpg'
import HeaderText from "../../HeaderTextt/HeaderText";

function Trending() {
    return (
        <div className="trending section">
            <HeaderText text="Trending"/>
            <div className="trending-boxes">
                <div className="trending-box">
                    <img src={ExampleImage}/>
                    <Button text="Some text"/>
                </div>

                <div className="trending-box">
                    <img src={ExampleImage}/>
                    <Button text="Some other text"/>
                </div>

                <div className="trending-box">
                    <img src={ExampleImage}/>
                    <Button text="And some other text"/>
                </div>
            </div>
        </div>

    );
}

export default Trending;
